use `sqlipa1`;
-- ----------------------------
-- Table structure for log
-- ----------------------------
DROP TABLE IF EXISTS `log`;
CREATE TABLE `log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `activity` varchar(255) DEFAULT NULL,
  `status` enum('0','1') DEFAULT NULL,
  `scheme` tinyint(4) DEFAULT NULL,
  `timeval` float DEFAULT NULL,
  `bit` int(255) DEFAULT NULL,
  `saltnum` int(11) DEFAULT NULL,
  `datanum` int(11) DEFAULT NULL,
  `memory` varchar(255) DEFAULT NULL,
  `query` varchar(255) DEFAULT NULL,
  `session_data` varchar(255) DEFAULT NULL,
  `datetime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2471 DEFAULT CHARSET=latin1;


